webpackJsonp([53981054996225],{477:function(e,t){e.exports={data:{markdownRemark:{html:'<p>With Trac integration, HackerOne makes it easy for you to link Trac issues as references on the platform.</p>\n<p>In order to configure Trac integration for your team, contact HackerOne with the following information:</p>\n<li> The base URI of the Trac instance (e.g., "https://trac.company.com/")\n<li> The component you\'d like issues to default to\n<li> The type you\'d like issues to default to\n<li> Any other custom keywords/fields you\'d like prepopulated. Options are described here: http://trac.edgewall.org/wiki/TracTickets#PresetValuesforNewTickets\n<p>With all of the provided information, HackerOne will be able to set up your requested integration. You’ll get an email notification letting you know that your integration has been set up within 1-2 business days.</p>\n<h3>How the Integration Works</h3>\n<p>After your Trac integration has been set up:</p>\n<ol>\n<li>Change the action picker to <strong>Change state > Triaged</strong> in your report. </li>\n</ol>\n<p><img src="https://github.com/Hacker0x01/docs.hackerone.com/blob/master/docs/programs/images/integrations.png?raw=true" alt="integrations"></p>\n<ol start="2">\n<li>Click <strong>Escalate</strong>.</li>\n<li>You’ll be taken to your Trac account where the report is pre-populated. Submit the issue to create the report in Trac.</li>\n<li>Copy the Trac report issue number and paste it in the <strong>Reference ID</strong> field of the HackerOne report to create a direct reference link to the issue in Trac.  </li>\n</ol>',frontmatter:{path:"/programs/trac-integration",title:"Trac Integration"}}},pathContext:{}}}});
